  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Waubay National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1962. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, mammals,
  and raptors- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing and haying. The public relations section of the report describes recreational
  uses, Refuge visitors, and Refuge participation. Photos are attached.\",\n\t\"owner_org\":
